import styled from 'styled-components';
import Pesquisa from '../componentes/Pesquisa';
import FrameHome from '../componentes/FrameHome';

const AppContainer = styled.div`
width: 100%;
height: 100%;
display: flex;
flex-direction: column;  
flex-wrap: nowrap;
justify-content: center;
align-items: center;
padding-top: 20px;
gap: 20px;
// background-color: green;
background: linear-gradient(135deg,  #dee2e8ff 0%,  #3a6ea5 25%,  #002f52 75%,  #002f52 100%);
`

function Home() {
  return (
    <AppContainer>
      <Pesquisa />
      <FrameHome />
    </AppContainer>
  );
}

export default Home;
